package dsasheet.strings.easy;

import java.util.*;

public class ValidAnagram {
    public static void main(String[] args) {
        String s = "anagram", t = "nagaram";
//        s="rat";
//        t=
        s = "";
        t = "";
        System.out.println(isAnagram2(s,t));
    }

    public static boolean isAnagram(String s, String t) {
        if(s.length() != t.length()) {
            return false;
        }
        int[] c1 = new int[26];
        int[] c2 = new int[26];

        for (int i = 0; i < s.length(); i++) {
            c1[s.charAt(i)-'a']++;
        }
        for (int i = 0; i < t.length(); i++) {
            c2[t.charAt(i)-'a']++;
        }
        for (int i = 0; i < 26; i++) {
            if(c1[i]!=c2[i]) {
                return false;
            }
        }
        return true;
    }

    public static boolean isAnagram2(String s, String t) {
        if(s.length() != t.length()) {
            return false;
        }

        Map<Character, Integer> c1 = new HashMap<>();
        Map<Character, Integer> c2 = new HashMap<>();

        for (int i = 0; i < s.length(); i++) {
            char ch = s.charAt(i);
            if(c1.containsKey(ch)) {
                c1.replace(ch, c1.get(ch) + 1);
            } else {
                c1.put(ch, 1);
            }
        }
        for (int i = 0; i < t.length(); i++) {
            char ch = t.charAt(i);
            if(c2.containsKey(ch)) {
                c2.replace(ch, c2.get(ch) + 1);
            } else {
                c2.put(ch, 1);
            }
        }

        for(char key : c1.keySet()) {
            if(!Objects.equals(c1.get(key), c2.get(key))) {
              return false;
            }
        }
        return true;
    }
}
